import '../styles/author.css';

const Author = (props) => {
    const { author, genre } = props;
    return (
        <div className='author-block'>
            <div>
                <p id='author-p'>{author}</p>
                <p id='genre-p'>{genre}</p>
            </div>

            <div className='symbol-arrow'>
                <span class="material-symbols-outlined">
                    arrow_forward
                </span>
            </div>

        </div>
    );
}

export default Author;
